import React from "react";
import { Parallax } from "react-scroll-parallax";

export const Sinhagad = () =>{
    return <div>
        <div className="h-screen w-full flex pt-6 pl-12 pr-3 -mt-3">
            {/* Data */}
            <div className="w-1/2">  
                Sinhagad


            </div>
            {/* Poster */}
            <div className="w-1/2 h-full">
                <img className="object-cover h-full w-full rounded-3xl" src={require("../../assets/treks/RajGad.jpg")} alt="" />
            </div>
        </div>
    </div>
}
